import "./App.css";
import styled from "styled-components";
import { useAppSelector } from "./hooks";
import { stat } from "fs";

const Wrapper = styled.div`
  padding: 1.5rem;
`;

const Title = styled.h2`
  font-weight: 900;
  margin-top: 2rem;
`;

const NoteInput = styled.input`
  width: 100%;
  height: 40px;
  border-radius: 10px;
  padding-left: 0.5rem;
  box-sizing: border-box;
`;

const SubmitBtn = styled.button`
  width: 100%;
  box-sizing: border-box;
  height: 40px;
  background: #000;
  display: flex;
  justify-content: center;
  align-items: center;
  color: #fff;
  border-radius: 10px;
  border: 0;
  font-weight: 900;
  margin-top: 1rem;

  :active {
    background: #000000be;
  }
`;

const Item = styled.div`
  margin-top: 1rem;

  > b {
    margin-right: 0.5rem;
  }
`;

function App() {
  const list = useAppSelector((state) => state.todoReducer);
  return (
    <Wrapper>
      <Title>TODO LIST</Title>
      <NoteInput type="text" />
      <SubmitBtn>Submit</SubmitBtn>
      <SubmitBtn>Record Timestamp</SubmitBtn>
      <Title>List</Title>
    </Wrapper>
  );
}

export default App;
